#!/usr/bin/ruby
srand 0

APP_PATH = File.expand_path('../../config/application',  __FILE__)
require File.expand_path('../../config/boot',  __FILE__)
require APP_PATH
Rails.env = ENV['RAILS_ENV'] || 'development'
Rails.application.require_environment!


t0 = Time.now.at_beginning_of_year

tags = ['red', 'blue', 'green',
        'black', 'purple', 'salmon',
        'turquoise', 'orange', 'white']
paragraphs = DATA.read.split(/\n+/)
until paragraphs.empty?
  title, body = nil, ''
  (1+rand(4)).times do
    line = paragraphs.pop or break
    title ||= line.split('.')[0]
    body << "#{line}\n\n"
  end

  tagset = tags.shuffle
  Note.new.tap do |note|
    note.date = t0
    note.title, note.body = title, body.strip
    rand(4).times do
      note.tags.build(:label => tagset.pop)
    end
    note.save
  end
  t0 += (rand ** 2) * 24*3600
end

__END__
